import timeit


class Solution:
    def find_i_pair(self, index, value, pair):
        for i in pair:
            if i["value"] == value and i["index"] == index:
                return True

        return False

    def remove_pair_from_list(self,char_list, pair):
        # print('remove_pair_from_list char_list: ;',char_list)
        # print('pair char_list: ;',pair)
        remove_item = char_list.pop(pair[0]["index"])
        remove_item = char_list.pop(pair[1]["index"]-1)
        return char_list


    def isValid(self, s: str) -> str:
        char_list = s

        starting_list = ['(','[','{']
        tail_list = [')',']','}']

        starting_list_set = set(starting_list)
        tail_list_set = set(tail_list)

        done_pair = []

        find_pair = []
        skip_now = False
        i = 0
        j = 0
        outer_loop = True

        if len(s) == 1:
            return False

        while len(char_list) > 0:
        # while i < 10:
            print('Start outer loop')
            print('Find_pair', find_pair)
            print('Done_pair', done_pair)
            print('New char list', char_list)

            if len(find_pair) == len(char_list):
                return False

            while j < len(char_list):
                print('---------------------------------')
                print('Start inner loop')
                print('J: ',char_list[j])

                if self.find_i_pair(j,char_list[j], find_pair):
                    print('---------------------------------')
                    print('Inside skip condition found in find_pair')
                    print(f'Skipping this index: {j} with value: {char_list[j]}')
                    j = j + 1
                    continue

                # #
                # if starting_list.find(char_list[j]) > -1:
                if char_list[j] in starting_list_set:
                    print('---------------------------------')
                    print('Inside pair condition')
                    new_dict = { "index": j, "value": char_list[j]}
                    find_pair.append(new_dict)
                    break



                if len(find_pair) > 0:
                    print('---------------------------------')
                    print('Inside find tail condition')
                    find_pair_last_element = find_pair[-1]["value"]
                    find_pair_last_element_index = find_pair[-1]["index"]

                    find_tail_list = tail_list[int(starting_list.index(find_pair_last_element))]

                    if find_tail_list == char_list[j]:
                        print('---------------------------------')
                        print('I found a pair condition')
                        new_dict = {"index": find_pair_last_element_index, "value": find_pair_last_element}
                        done_pair.append(new_dict)
                        new_dict_tail = {"index": j, "value": char_list[j]}
                        done_pair.append(new_dict_tail)

                        new_char_list = list(char_list)
                        print('new_char_list',new_char_list)

                        updated_charlist = self.remove_pair_from_list(new_char_list,done_pair)
                        done_pair = []
                        print('updated_charlist: ', updated_charlist)
                        char_list = str("".join(updated_charlist))

                        print("char_list", char_list)

                        print('---------------------------------')
                        print('find_pair befor pop', find_pair)
                        print('---------------------------------')
                        find_pair.pop()

                        print('---------------------------------')
                        print('find_pair now', find_pair)
                        print('break!')

                        j = 0
                        print('reset j')
                        break
                    else:
                        return False

                if char_list[j] in tail_list_set:
                    print('here')
                    return False

                j = j + 1
            i = i + 1

        # print('the last')
        return True

